import React from "react"

const Results = props => (
  <div id="results">
    <h3 className="title">Results</h3>
    <p id={props.dataId}>Title: {props.title}<br></br>Link: {props.url}<br></br>Published on {props.date} at {props.time}</p>
  </div>
);

export default Results;
